import './App.css';
import React, { useEffect } from "react";
import Home from './Home.js';
import Header from './Header.js'
import MenuScreen from './MenuScreen.js';
import RewardsScreen from './RewardsScreen.js';
import GiftScreen from './GiftScreen.js';


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/">
            <Header></Header>
            <Home></Home>
          </Route>
          <Route exact path="/menu">
            <Header></Header>
            <MenuScreen />
          </Route>
          <Route exact path="/gifts">
            <Header></Header>
            <GiftScreen />
          </Route>
          <Route exact path="/rewards">
            <Header></Header>
            <RewardsScreen />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
